transitions.content:
article,aside,details,figcaption,figure,footer,header,hgroup,nav,section,summary{display:block}
audio,canvas,video{display:inline-block}
audio:not([controls]){display:none;height:0}
[hidden]{display:none}
html{font-family:sans-serif;-webkit-text-size-adjust:100%;-ms-text-size-adjust:100%}
a:focus{outline:thin dotted}
a:active,a:hover{outline:0}
h1{font-size:2em}
abbr[title]{border-bottom:1px dotted}
b,strong{font-weight:700}
dfn{font-style:italic}
mark{background:#ff0;color:#000}
code,kbd,pre,samp{font-family:monospace, serif;font-size:1em}
pre{white-space:pre-wrap;word-wrap:break-word}
q{quotes:\201C \201D \2018 \2019}
small{font-size:80%}
sub,sup{font-size:75%;line-height:0;position:relative;vertical-align:baseline}
sup{top:-.5em}
sub{bottom:-.25em}
img{border:0}
svg:not(:root){overflow:hidden}
fieldset{border:1px solid silver;margin:0 2px;padding:.35em .625em .75em}
button,input,select,textarea{font-family:inherit;font-size:100%;margin:0}
button,input{line-height:normal}
button,html input[type=button],/* 1 */
input[type=reset],input[type=submit]{-webkit-appearance:button;cursor:pointer}
button[disabled],input[disabled]{cursor:default}
input[type=checkbox],input[type=radio]{box-sizing:border-box;padding:0}
input[type=search]{-webkit-appearance:textfield;-moz-box-sizing:content-box;-webkit-box-sizing:content-box;box-sizing:content-box}
input[type=search]::-webkit-search-cancel-button,input[type=search]::-webkit-search-decoration{-webkit-appearance:none}
textarea{overflow:auto;vertical-align:top}
table{border-collapse:collapse;border-spacing:0}
body,figure{margin:0}
legend,button::-moz-focus-inner,input::-moz-focus-inner{border:0;padding:0}

/*

Theme Name: Taco Shack

Version: 1.0

*/



@font-face {

	font-family: 'league';

	src: url('fonts/league_gothic-webfont.eot');

	src: url('fonts/league_gothic-webfont.eot?#iefix') format('embedded-opentype'),

		url('fonts/league_gothic-webfont.woff') format('woff'),

		url('fonts/league_gothic-webfont.ttf') format('truetype'),

		url('fonts/league_gothic-webfont.svg#league_gothicregular') format('svg');

	font-weight: normal;

	font-style: normal;

}



html,

body {

	width: 100%;

	height: 100%;

}



body {

	position: relative;

	min-width: 920px;

	background: url(images/body_bg.png) 0 -30%;

	font-family: Arial, Helvetica, Tahoma, sans-serif;

}



/* =Miscellaneous */



.brown {

	color: #ebd19d;

}



ul.justified_list {

	list-style: none;

	margin: 0;

	padding: 0;

	text-align: justify;	

	line-height: 0;

	font-size: 1px;

	text-justify: newspaper;

	zoom: 1;

	text-align-last: justify;

}

ul.justified_list:after {

	width: 100%; 

	height: 0px;

	visibility: hidden;

	overflow: hidden;

	content: '';

	display: inline-block;

}

ul.justified_list > li  {

	display: inline-block;

	line-height: 16px;

	text-align: center;

	vertical-align: top;

	/* IE */

	//display: inline;

	//zoom: 1;

}



/* =Header */



#header {

	width: 100%;

	padding-top: 157px;

	background: url(images/header.jpg) no-repeat 50% 0;

}

#header_bg {

	width: 100%;

	height: 160px;

	position: absolute;

	z-index: -1;

	top: 0px;

	left: 0px;

	background: #ae4c01;

}



/* =Navigation */



#header_nav {

	position: relative;

	z-index: 1;

	width: 100%;

	height: 72px;

	background: url(images/wood.png) repeat-x 50% 0;

}

#header_nav ul {

	width: 780px;

	margin: 0 auto;

	padding: 0;

}

#header_nav ul li {

	display: inline-block;

	margin-right: 24px;

	/* IE */

	//display: inline;

	//zoom: 1;

}
#header_nav ul li:last-child {
	margin-right: 0;
}
#header_nav ul li a {

	font: 30px/58px league;

	text-decoration: none;

	text-transform: uppercase;

	color: #fff;

	text-shadow: 1px 1px 2px #0c0c0c;

	filter: dropshadow(color=#0c0c0c, offx=1, offy=1);

}

#header_nav ul li a:hover {

	color: #fd9802;

}

#header_nav ul li.current-menu-item a,
#menu-taco-mobile-menu li.current-menu-item a{
	color:#fd9802 !important;

}



/* =Content */



#page{

  height:auto;

	width: 920px;

	margin: -15px auto 0 auto;

	padding-bottom: 70px;

	background: #ceaa76 url(images/page_bg.png) repeat-y 50% 0;

	min-height:100%;

	

}

#page #content{

	margin:0 auto;

	width:820px;

}

#page .entry-title{

	color:#cc6600;

	font-size:44px;

	font-family:'league';

	font-weight: 400;

	text-transform:uppercase;

	margin:0;

	padding: 45px 0 0 50px;

}

#page .entry-content{

	margin:0 50px;

}



/* Locations page */



.location{

	background-color:#cc6600;

	height:190px;

	width:858px;

	color:#fff;

	position: relative;

	margin: 0 0 10px -20px;

	font-size: 14px;

	-webkit-border-radius: 20px;

	-moz-border-radius: 20px;

	border-radius: 20px;

}



.locationMenu{

	float:left;

	clear:both;

	overflow:hidden;

	padding: 3px 0 0;

	text-decoration:none;

	color:#ffffff;

	font-weight:bold;

	font-size: 11px

}



.locationContent{

	margin:0 0 0 25px;	

}

.location .photo{

	float:left;

	margin:23px 10px 0 0 ;

}

.locationContent .map{

	position: absolute;

  right: 34px;

  top: 17px;

	text-align:center;

}

.locationContent .map p{

	margin:0;	

}

.locationContent .map img{

	width:195px;

	height:142px;

}

.locationContent .map .viewMap{

  font-size:11px;

	text-decoration:none;

	margin:-2px 0 0 0;

	display:block;

	color:#ffcc00;

}

.location .photo img{

	width:124px;

	height:80px;

	float:left;

	border:5px solid #fff;

}

.location h3{

	text-transform:uppercase;

	margin:0;

	padding: 22px 0 0 0;

	font: 34px/32px league;

}

.locationLine{

	font-size: 15px;

	font-style:italic;

	font-weight: bold;

	color:#ffcc00;

	line-height: 26px;

}

.location .contact{

	float:left;

	display:block;

	margin: 0 0 12px;

}

.location .worktime{

	clear: both;

	font-size:11px;

	float:left;

}

.location .worktimeItem{

	float:left;

	width:175px;

}

.location .worktimeItem .dayName{

	text-transform:uppercase;

	font-weight:bold;

}

.location .worktimeItem span{

	color:#ffcc00;

}



/* =Footer */



#footer {

	position: fixed;

	left: 0;

	bottom: 0;

	width: 100%;

	height: 43px;

	padding: 13px 0 0;

	background: url(images/wood.png) repeat-x 50% 0;

}

#footer a {

	text-decoration: none;

	color: #fff;

}

#footer a:hover {

	text-decoration: underline;

}

#footer ul.footer_content {

	width: 900px;

	margin: 0 auto;

	font-size: 11px;

	color: #fff;

}

#footer_nav ul {

	margin: 2px 0 0;

	padding: 0;

}

#footer_nav ul li {

	display: inline-block;

	margin-right: 3px;

	padding-right: 5px;

	line-height: 12px;

	border-right: 1px solid #fff;

	/* IE */

	//display: inline;

	//zoom: 1;

}

#footer_nav ul li:last-child,

#footer_nav ul li.last_menu_item {

	border-right: none;

}

#footer_nav li a {

	font-weight: 700;

	font-size: 10px;

	text-transform: uppercase;

}

.social img {

	margin-top: 1px;

}

.copyright {

	float:left;

	font-weight: normal;

}



/* Front page */



#front_slider {

	position: relative;

}

#front_slider img {

	position: absolute;

	left: 0;

	top: 0;

	width: 100%;

	height: 373px;

}

.front_page .justified_list a {

	display: block;

}

.front_page .subfeat {

	margin-bottom: 18px;

}

.subfeat_left a {

	width: 279px;

	height: 205px;

	background: url(images/subfeat_left.png) no-repeat 50% 0;

}

.subfeat_middle a {

	width: 280px;

	height: 205px;

	background: url(images/subfeat_middle.png) no-repeat 50% 0;

}

.subfeat_right{

	width: 279px;

	height: 205px;

	background: url(images/subfeat_right.png) no-repeat 50% 0;

}

.subfeat_right a{

	width:286px;

	height:200px;

}

.large_orders a {

	width: 206px;

	height: 105px;

	background: url(images/large_orders.png) no-repeat 50% 0;

}

.gift_cards a {

	width: 206px;

	height: 105px;

	background: url(images/gift_cards.png) no-repeat 50% 0;

}

.join .mailing_list {

	width: 429px;

	height: 105px;

	background: url(images/mailing_list.png) no-repeat 50% 0;

	font-size: 12px;

	position: relative;

}

.join .wpcf7 {

	padding-top: 62px;

	padding-left: 20px;

}

.join p {

	margin: 0;

}

.join label {

	color: #ffcc66;

}

.join .wpcf7-text {

	border: 1px solid #e9c49f;

	padding: 3px 2px;

	width: 200px;

	font-weight: 700;

}

.join .wpcf7-submit {

	width: 76px;

	height: 26px;

	border: none;

	text-indent: -9999px;

	background: url(images/send_button.png) no-repeat 50% 50%;

}

.join .wpcf7-response-output {

	position: absolute;

	font-size: 17px;

	color: #fff;

	top: 7%;

	left: 5%;

	text-align: center;

	background: #b33f00;

}

.join .wpcf7-mail-sent-ok {

	background: #35960C;

}

.join .wpcf7-validation-errors {

	display: none !important;

	background: #f1b707;

	border: 1px solid #f9c72f;

}

.join .wpcf7-not-valid-tip {

	top: 30% !important;

	left: 4% !important;

	width: 170px !important;

}



.shopItem{

	width:265px;

	float:left;

	overflow: hidden;

	margin-top:30px;

	text-align:center;

}



.shopItem h4{

	margin:14px 0 0 0;

	padding:0;

	font-size:15px;

	font-weight:bold;

	font-family:Arial;

	text-transform:uppercase;

}



.shopItem p{

	margin:0;

	padding:0;

}



.shopItem .price{

  font-style: italic;

	font-family:Georgia;

	font-size:20px;

}



.shopItem .desc{

	font-family:Georgia;

	font-size:13px;

	display: block;

	margin-top:3px;

}



/*

 *About 

 */



#aboutLeft{

	float:left;

	font-family:Georgia;

	color:#993300;

	margin:22px 0 0 0;

	width:492px;

}



#aboutLeft .top{

	line-height:28px;

	font-size:17px;

}



#aboutLeft .top span{

	text-align:right;

}



#aboutLeft .top span {

	text-align: right;

	float: right;

}



#aboutLeft .bottom{

	margin:86px 0 0;

}



#aboutLeft .bottom .head{

	float:left;

	border-bottom:1px solid #993300;

} 



#aboutLeft .bottom .head h3{

	font-family:Arial;

	font-weight:bold;

	margin:0;

	padding:0;

	text-transform:uppercase;

	font-size:15px;

}



#aboutLeft .bottom .head p{

	margin:0;

	padding:0px 0 8px;

}



#aboutLeft .bottom .head span{

	font-size:17px;

}



#aboutLeft .bottom .text{

	clear:left;

	font-size:12px;

	padding:14px 0 0;

	line-height:19px;

}



#aboutLeft .bottom .text p{

	padding-bottom:7px;

}



#aboutRight{

	float:left;

	margin:-68px 0 0 0;

	width:325px;

}



#aboutRight .photo{

	margin:0 0 0 8px;

}



#aboutRight .mission{

	font-family:Arial;

	color:#993300;

	padding:2px 0 0 69px;

	font-size:12px;

	font-weight:normal;

}



#aboutRight .mission span{

	font-weight:bold;

	font-size:15px;

	text-transform:uppercase;

}



/*

 * Menus

 */



#toTop{

	background-image:url('images/old_go_top.png');

	background-repeat:no-repeat;

	background-position:25px 25px;

  height: 90px;

  width: 90px;

	text-align:center;

	cursor:pointer;

	position:fixed;

	outline:none;

	border:0;

	bottom:100px;

	margin:0 0 0 880px;

	display:none;

}



#menus{

	margin: 20px 0 0;

  position: relative;

  width: 100%;

	color:#993300;

	font-family:Arial;

}



#menus .anchor{

	color: #ff9701;

  font-size: 20px;

  font-weight: normal;

  text-decoration: none;

}

#menus .anchor:hover{

	color:#993300;

}



#menus a.breakfast{

	

}

#menus .lunch{

	

}

#menus .drinks{

	

}



#menus .pdf{

	width:300px;

	display:block;

	color:#993300;

	text-decoration:underline;

	padding:20px 0 0;

	background-image:url('images/pdf.png');

	background-repeat:no-repeat;

	background-position:220px 7px;

}

#menus .pdfDesc{

	font-style:italic;

	font-size:14px;

}



#menus .menu{

	width:800px;

	margin: 50px 0 0;

}

#menus .menu h3{

	margin:0;

	padding:0;

	border-bottom:1px solid #663300;

	text-transform:uppercase;

}



#menus .menu ul{

	

}



#menus .menu h4{

	margin:0;

	padding:15px 0 0 10px;

	text-transform:uppercase;

	border-bottom: 1px dotted #663300;

}



#menus .menu .content{

	padding:0 0 0 0px;

	margin:0 0 45px;

}



#menus .menuItem{

	padding:10px 0 15px 15px;

	overflow: hidden;

}



#menus .menuItem .name{

	float:left;

	width:425px;

	font-size:14px;

	font-weight:bold;

}



#menus .menuItem .price{

	font-size:14px;

	font-weight:bold;

