.menu-image {
	position: relative;
}
.menu-image > img{
	display: block;
	margin: 0 auto;
}
.menu-pdf {
	position: absolute;
	top: 0;
	right: 8%;
	width: 14%;	
}
.menu-pdf > img {
	width: 100%;
}
#menu-taco-mobile-menu {
	padding: 20px 0 0 0;
	text-align: center;
	list-style: none;
	margin: 0 0 40px 0;
}
#menu-taco-mobile-menu li {
	display: inline-block;
	margin: 0 12px;
}
#menu-taco-mobile-menu li a{
	font: 40px/58px league;
	text-decoration: none;
	text-transform: uppercase;
	color: #fff;
	text-shadow: 1px 1px 2px #0c0c0c;
	filter: dropshadow(color=#0c0c0c, offx=1, offy=1);
}
#menu-taco-mobile-menu li a:hover {
	color: #fd9802;
}
#menu-main_navigation .menu-mobile {
	display: none;
}
.postid-416 .menu-pdf {
	right: 1%;
}
@media (max-width: 1024px) {
	.single-taco-menu #page,
	.single-taco-menu,
	.single-taco-menu #header_nav ul{
		width: 100%;
		min-width: initial;
	}
	.single-taco-menu #header_nav ul {
		text-align: center
	}
	.single-taco-menu #header_nav ul li {
		margin-right: 20px;
	}
	.single-taco-menu #header_nav ul li a{
		font: 25px/58px league;
	}
	.single-taco-menu #header {
		background-size: 100%;
		padding-top: 9%;
	}
}
@media (max-width: 767px) {
	.menu-image img{
		max-width: 100%;
		height: auto;
	}
	.single-taco-menu #header_nav ul li a{
		font: 18px/58px league;
	}
	#menu-main_navigation .menu-desktop {
		display: none;
	}
	#menu-main_navigation .menu-mobile {
		display: inline;
	}
}
@media (max-width: 480px) {
	#menu-taco-mobile-menu li a{
		font: 20px/36px league;
	}
	#menu-taco-mobile-menu li {
		display: inline-block;
		margin: 0 6px;
	}
	.single-taco-menu #header_nav ul li {
		margin-right: 5px;
	}
	.single-taco-menu #header_nav ul li a {
		font: 13px/58px league;
	}
}
@media (max-width: 319px) {
	#menu-taco-mobile-menu li a{
		font: 16px/36px league;
	}
}

div.wpcf7 {
	margin: 0;
	padding: 0;
}

div.wpcf7-response-output {
	margin: 2em 0.5em 1em;
	padding: 0.2em 1em;
}

div.wpcf7 .screen-reader-response {
	position: absolute;
	overflow: hidden;
	clip: rect(1px, 1px, 1px, 1px);
	height: 1px;
	width: 1px;
	margin: 0;
	padding: 0;
	border: 0;
}

div.wpcf7-mail-sent-ok {
	border: 2px solid #398f14;
}

div.wpcf7-mail-sent-ng {
	border: 2px solid #ff0000;
}

div.wpcf7-spam-blocked {
	border: 2px solid #ffa500;
}

div.wpcf7-validation-errors {
	border: 2px solid #f7e700;
}

.wpcf7-form-control-wrap {
	position: relative;
}

span.wpcf7-not-valid-tip {
	color: #f00;
	font-size: 1em;
	font-weight: normal;
	display: block;
}

.use-floating-validation-tip span.wpcf7-not-valid-tip {
	position: absolute;
	top: 20%;
	left: 20%;
	z-index: 100;
	border: 1px solid #ff0000;
	background: #fff;
	padding: .2em .8em;
}

span.wpcf7-list-item {
	display: inline-block;
	margin: 0 0 0 1em;
}

span.wpcf7-list-item-label::before,
span.wpcf7-list-item-label::after {
	content: " ";
}

.wpcf7-display-none {
	display: none;
}

div.wpcf7 .ajax-loader {
	visibility: hidden;
	display: inline-block;
	background-image: url('../../images/ajax-loader.gif');
	width: 16px;
	height: 16px;
	border: none;
	padding: 0;
	margin: 0 0 0 4px;
	vertical-align: middle;
}

div.wpcf7 .ajax-loader.is-active {
	visibility: visible;
}

div.wpcf7 div.ajax-error {
	display: none;
}

div.wpcf7 .placeheld {
	color: #888;
}

div.wpcf7 .wpcf7-recaptcha iframe {
	margin-bottom: 0;
}

div.wpcf7 input[type="file"] {
	cursor: pointer;
}

div.wpcf7 input[type="file"]:disabled {
	cursor: default;
}

var Custom = function(){
  
  var $this = this;
  
  this.init=function(){
    
		$('.anchor').click(function(){
			link=$(this).attr('href');
			dest=$(link).offset().top;
			$("html, body").animate({scrollTop: dest}, 500);
			return false;
		});

			
		$(document).scroll(function(){
			tar = $("#toTop");
			cur = $(tar).offset();
			
			if(cur === null) return;
			
			if(cur.top>1000){
				$(tar).css('display','block');
			}
			else if(cur.top<1000){
				$(tar).css('display','none');
			}
		});

  }
  
  this.init();
}


$(document).ready(function(){
  var custom = new Custom();
});

